column13:
A drum magazine assembly and methods are described. A drum magazine assembly for a firearm comprising a magazine housing defining a track (303); and 
a follower assembly; 
wherein the magazine housing is configured to constrain a cartridge as the cartridge is moved within the magazine assembly such that majority of a proximal surface area of the cartridge does not contact the magazine housing, and a distal tip of the cartridge does not contact the magazine housing.
